This initiative was founded by writer and actress Christina Kyriazidi (aka @c_and_her_stories) and is devoted to the collection and archiving of previously undocumented stories. Whether it’s a memory of a grandparent, a humorous exchange, a love story or an anecdote about a long lost friend, the tales that have been gathered to date are personal and provide an insight into the lives, thoughts and memories of others. 

To celebrate 4 years of the STORY FOR FOOD project and 2 years of our radio show on Colaboradio @ Berlin Brandenburg Freies Radios, we are hosting a special event in Berlin. 

On the 27th September we invite you to join our 【﻿ＳＴＯＲＹ　ＣＩＲＣＬＥ】at DAS KAPiTAL in Neukölln (aka @kapital.berlin) to listen to some of the stories and anecdotes that have been told to us and saved over the years. You will also have the opportunity to step into the circle, share live a story or two and become part of the SFF Audio Archive.

